import React from "react";
const videos = [
  {
    id: "WfC8F4NTPfU",
    title: "The Office - Opening Theme (Extended)",
  },
  {
    id: "mWk6bxy9niE",
    title: "Friends Theme Song (I'll be there for you)",
  },
  {
    id: "5PSNL1qE6VY",
    title: "Breaking Bad Theme (Extended)",
  },
  {
    id: "4B4vJ1ku4z8",
    title: "Game of Thrones Theme (Extended)",
  },
  {
    id: "wJnBTPUQS5A",
    title: "Stranger Things Theme (Extended)",
  },
  {
    id: "0GhFzv7x5-g",
    title: "The Crown Theme",
  },
];



const Carou = ({ index, onClick }) => (

  <div
    className="relative w-full h-full"
    onClick={() => onClick && onClick(index)}
  >
    <img
      src={`https://img.youtube.com/vi/${videos[index].id}/maxresdefault.jpg`}
      alt={videos[index].title}
      className="object-cover w-full h-full"
    />
    <iframe
      title={videos[index].title}
      src={`https://www.youtube.com/embed/${videos[index].id}`}
      width="560"
      height="315"
      className="absolute inset-0 m-auto"
    />
  </div>
);

export default Carou;
